import axios from "axios";
import react,{ useEffect,useState } from "react";
import { useParams } from "react-router-dom";

const CasasDetail = () => {
    const urlCasasDetail = ''
    const [CasasDetail, setCasasDetail] = useState ({});
    let {id} = useParams();
    useEffect (() => {
        const getCasasDetail = async () =>{
            const res = await axios.get (urlCasasDetail+'/'+id)
            setCasasDetail(res.data)

        }
        getCasasDetail()
    },[])
    console.log(CasasDetail)
    return (<div>
        <div >{CasasDetail.title}</div> 
        <img alt="Imagen de filmsDetail" src={CasasDetail.image}/>
        <div >{CasasDetail.description}</div> 
    </div>)
}





export default CasasDetail
